import React from "react";
import './tours.css'

export default function Tours(props){
    return(
        <div className="header">
             <h1 id="text">Our Tours</h1>
             <div>
                {
                    props.tours.map((tour) => {
                        const {id,name,image,info,price} = tour;

                        return (
                            <article key={id} className="cards">
                                <div>
                                    <h2>{name}</h2>
                                    <h4 id="ifo">{price}</h4>
                                    <p id="info">{info}</p> 
                                    <img src={image}  ></img>
                                </div>
                            </article>
                        )

                    })
                }
             </div>

        </div>
       
    )
}
